      let right:f32 = 1 - 2 * (scrollBarMargin + f32uni.overscroll.x + scrollBarRadius * 2) / f32uni.canvasSize.x;
      output.position = rectangleVertexPosition(input.vertexIndex - 6, left, top, right, bottom);
